import React from "react";
import "./App.css";
import Home from "./Home";
import Cart from "./Cart";
import { BrowserRouter,Router,Route } from "react-router-dom";

const App = () => {
  return (
    <>

      <BrowserRouter>
      <Router>
      <Home />
      <Route path='/cart' element={<Cart/>} />
      </Router>
      </BrowserRouter>
    </>
  );
};

export default App;
